import Items from "./Items";

export function apiCall(page: number, size: number, patientId: number): Promise<Items> {
    return new Promise<Items>(() => new Items(
        [
            {id: 1, date: new Date(), prescriptionCount: 1, syndrome: "test1"},
            {id: 2, date: new Date(), prescriptionCount: 2, syndrome: "test2"},
            {id: 3, date: new Date(), prescriptionCount: 3, syndrome: "test3"},
            {id: 4, date: new Date(), prescriptionCount: 4, syndrome: "test4"}
        ],
        0,
        4,
        4))
}
